import{_get as e}from"../_modules/get/get";function newSearch(){location.reload()}async function getSubmissionData(){document.getElementById("viewData").innerHTML="requesting...",e("/api/manage/list","viewData").then(e=>{for(var n="",t=e.length-1;t>=0;t--)n+=`<fieldset><span><span>ID:&emsp;${e[t].id}</span>&emsp;&emsp;<span><a href="/detail?id=${e[t].id}" style="all: unset; color: #2997FF; text-decoration: none;">View</a>&emsp;<span onclick="deleteSubmission(${e[t].id}, 'main${e[t].id}')" style="color: red" id="main${e[t].id}">Delete</span></span></span></fieldset>`;document.getElementById("resultsInsert").insertAdjacentHTML("afterbegin",n),document.getElementById("search").style.display="none",document.getElementById("results").style.display="flex"})}async function deleteSubmission(n,t){document.getElementById(t).innerHTML="deleting...",e(`/api/manage/${n}/delete}`,t).then(e=>{3203===e.status&&(document.getElementById(t).innerHTML="deleted!")})}